import React, { Component } from 'react'
import { withRouter } from 'react-router-dom'
import { Button, Card, Table, Tag, Space } from 'antd'
import { PlusOutlined } from '@ant-design/icons';
import { connect } from 'react-redux';

const { Column } = Table;

const data = [
    {
        key: '1',
        fileName: 'GI-111111111',
        requestor: 'Melissa',
        submitDate: '2021-02-01',
        comment: 'New York No. 1 Lake Park',
        tags: ['Successful'],
    },
    {
        key: '2',
        fileName: 'DO-222222222',
        requestor: 'Anna',
        submitDate: '2021-02-02',
        comment: 'London No. 1 Lake Park',
        tags: ['Warning'],
    },
    {
        key: '3',
        fileName: 'DI-333333333',
        requestor: 'Marry',
        submitDate: '2021-02-03',
        comment: 'Sidney No. 1 Lake Park',
        tags: ['Error'],
    },
];

class GICheck extends Component {
    render() {
        const title = 'Check Global International Mobility Proxy Forms';
        const extra = (<Button type="primary" icon={<PlusOutlined />} onClick={() => this.props.history.push('/dashboard/gi-submit')}>Add</Button>)
        return (
            <Card title={title} extra={extra}>
                <Table dataSource={data}>
                    <Column 
                        title="File Name" 
                        dataIndex="fileName" 
                        key="fileName" 
                        render = {fileName => {
                            return <a href="javascript:;">{fileName}</a>    
                        }}
                    />
                    <Column title="Requestor" dataIndex="requestor" key="requestor" />
                    <Column title="Submit Date" dataIndex="submitDate" key="submitDate" />
                    <Column title="Comment" dataIndex="comment" key="comment" />
                    <Column
                        title="Status"
                        dataIndex="tags"
                        key="tags"
                        render={tags => (
                            <>
                                {tags.map(tag => {
                                    let color = "blue"
                                    return (
                                        <Tag color={color} key={tag}>
                                            {tag}
                                        </Tag>
                                    )
                                })}
                            </>
                        )}
                    />
                    <Column
                        title="Action"
                        key="action"
                        render={(text, record) => (
                            <Space size="middle">
                                <a>Details</a>
                            </Space>
                        )}
                    />
                </Table>
            </Card>
        )
    }
}

export default connect(
    state => ({}),
    {}
)(withRouter(GICheck))
